BEGIN;

  artista_id, importe, activo, fecha_modificacion, usuario_creacion,
  fecha, fecha_creacion, usuario_modificacion, matinal
)
SELECT
  a.id,
  s.tarifa::numeric(38,2),
  TRUE,
  NULL,
  'migracion_csv',
  ((s.fecha::timestamp + time '12:00') AT TIME ZONE 'Europe/Madrid') AS fecha,
  NOW(),
  NULL,
  FALSE
FROM staging.tarifa_src s
JOIN gestmusica.artista a
  ON a.id_artista_gestmanager = s.id_artista
WHERE NOT EXISTS (
  SELECT 1
  FROM gestmusica.tarifa t
  WHERE t.artista_id = a.id
    -- lmites del da en Madrid [00:00, 24:00)
    AND t.fecha >= (s.fecha::timestamp AT TIME ZONE 'Europe/Madrid')
    AND t.fecha <  ((s.fecha::timestamp + INTERVAL '1 day') AT TIME ZONE 'Europe/Madrid')
    and t.activo
);

COMMIT;


